import React from 'react';
import taskStyle from '..//Tasks/Task/Task.module.css';

const Syllabus = props => {
  alert('inside Syllabus');
  return (
    <React.Fragment>
      <tr key={props.particularKey}>
        <td>
          <button className={taskStyle.delete} onClick={props.click}></button>
        </td>
        <td>{props.name.toString()}</td>

        <td>{props.category.toString()}</td>
        <td>{props.concentration.toString()}</td>
        <td>{props.subject.toString()}</td>
        <td>{props.source.toString()}</td>
        <td>{props.syllabusCompletionTime.toString()}</td>
        <td>{props.completionStatus.toString()}</td>
      </tr>
    </React.Fragment>
  );
};

export default Syllabus;
